import "../css/Rank.css"
import axios from "axios"
// '/api/ranking'

const RankingPage = () => {
    //DB 데이터 가져오기    
    const fetchedDataFromDB = async () => {
        try {
            const res = await axios.get('/api/ranking');
            const data = res.data;

            console.log(data);
        }
        catch (error) {
            //오류 처리
            console.error(error);
        }
    }
    fetchedDataFromDB();
    return(
        <div id = "ranking-wrapper">
            <h1>Hall of Honor</h1>

            <ul id = "ranks">
                <li>hello world</li>
            </ul>
        </div>
    );
} 

export default RankingPage;
